import React from 'react';
import { ButtonGroup, Button } from 'react-bootstrap';


export const Continents = ({ continents, onClick }) => {
    return (
        <div>
            <ButtonGroup key="continents" size="lg" className="mb-2">
                {continents.map(cont => <Button key={cont} variant="secondary" onClick={onClick}>{cont}</Button>)}
            </ButtonGroup>
        </div>
    )
}
